(42730, '1204591-17-2', 'ACRYLOYLOXYPROPYL POLYSILSESQUIOXANE', 'ACRYLOYLOXYPROPYL POLYSILSESQUIOXANE', 100, 0, '-', 'Acryloyloxypropyl Polysilsesquioxane is a resinous material composed of a mixture of three-dimensional siloxane polymers and oligomers with cage structures. For the oligomers, each silicon atom in the polysilsesquioxane is connected via oxygen atoms to three other silicon atoms and can be represented by the empirical formulation RSiO3/2 where R represents the acryloxypropyl group. For the larger polymeric polysilsesquioxanes, some of the silicon atoms are not connected to other silicon atoms and instead have a silanol (SiOH) group. Acryloxypropyl Polysilsesquioxane is prepared by the hydrolysis and condensation of Acryloyloxy Propyltrimethoxysilane', '-', '-'),
